export const increment = () => {
    return {
        type: 'INCREMENT'
    }
};

export const decrement = () => {
    return {
        type: 'DECREMENT'
    }
};

const addNoteText = (note) => {
    return {
      type: 'ADD_NOTE',
      text: note
    }
  };
